import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Dashboard from '../pages/Dashboard.jsx';
import CreateTour from '../components/Manage-Tours/CreateTour.jsx';
import EditTour from '../components/Manage-Tours/EditTour.jsx';
import DeleteTour from '../components/Manage-Tours/DeleteTour.jsx';
import ManageTours from '../pages/ManageTours.jsx';

const AppRoutes = () => {
    return (

        <Routes>
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path='/home' element={<Home />} />
            <Route path='/about' element={<About />} />
            <Route path='/tours' element={<Tours />} />
            <Route path='/contact' element={<Contact />} />
            <Route path='/tours/:id' element={<TourDetails />} />
        </Routes>

    );
};

export default AppRoutes;
